var handleDataTableTools = function() {
    "use strict";
    if ($("#data-table").length !== 0) {
        $("#data-table").DataTable({
            dom: 'T<"clear">lfrtip',
            tableTools: {
                sSwfPath: "assets/plugins/DataTables/swf/copy_csv_xls_pdf.swf"
            }
        })
    }
};
var TableManageTableTools = function() {
    "use strict";
    return {
        init: function() {
            handleDataTableTools()
        }
    }
}()